INSERT INTO `regions` (`no_region`, `nom`, `surface`, `description`, `url_wiki`) VALUES
(11, 'Île-de-France', 12012, 'L’Île-de-France (prononcé `il də fʁɑ̃s`) est une région historique et administrative de France. Il s\'agit d\'une région très fortement peuplée qui représente à elle seule 18,8% de la population de la France métropolitaine, ce qui en fait la région la plus peuplée et à la plus forte densité de France. Ses habitants sont appelés Franciliens et Franciliennes. Elle est fortement centralisée sur l’agglomération parisienne, qui s’étend sur 20% de la surface régionale mais où habite 88% de sa population. L’aire urbaine de Paris (qui correspond à la notion de bassin d\'emploi) recouvre quant à elle la quasi-totalité de la superficie francilienne.\r\n\r\nAvec un PIB de 552 700 millions d\'euros et un PIB/habitant de 47 126 euros en 2008, c\'est sans conteste la région qui produit le plus de richesse en France. L’Île-de-France est également un pôle européen de premier ordre puisque c\'est la deuxième région européenne en termes de PIB comparés selon la méthode dite « à parité de pouvoir d\'achat », juste derrière la Rhénanie-du-Nord-Westphalie et la sixième région d\'Europe en termes de PIB par habitant, derrière la région métropolitaine de Prague en République tchèque mais devant les Southern and Eastern (Dublin) en Irlande.', 'http://fr.wikipedia.org/wiki/%C3%8Ele-de-France'),
(21, 'Champagne-Ardenne', 25606, 'La Champagne-Ardenne est une région du nord-est de la France. Elle est bordée au nord par la Belgique, à l\'ouest par la Picardie et l\'Île-de-France, au sud par la Bourgogne et à l\'est par la Franche-Comté et la Lorraine. Elle se compose de quatre départements : les Ardennes, l\'Aube, la Marne et la Haute-Marne. Avec 1 338 004 Champardennais, elle est l\'une des cinq régions les moins peuplées de France et la seule à avoir perdu des habitants entre 1999 et 2006. Sa préfecture est Châlons-en-Champagne alors que Reims, avec ses 218 000 habitants, et Troyes avec 130 000 habitants, sont plus importantes et plus peuplées.\r\nS\'étendant sur 25 606 km2, la Champagne-Ardenne rassemble la plaine de Champagne ainsi que les faibles reliefs du massif ardennais, au nord, et des coteaux de l\'est, accueillant notamment le vignoble de Champagne.', 'http://fr.wikipedia.org/wiki/Champagne-Ardenne'),
(22, 'Picardie', 19399, 'La Picardie est une région administrative du nord de la France qui regroupe trois départements : l\'Aisne, l\'Oise et la Somme. Son chef-lieu est Amiens. Cette région littorale (Manche orientale) est séparée du Nord-Pas-de-Calais par le fleuve Authie.', 'http://fr.wikipedia.org/wiki/Picardie'),
(23, 'Haute-Normandie', 12317, 'La Haute-Normandie, en référence à la latitude, mais d\'altitude plus basse que la Basse-Normandie, est une région de France créée en 1956 qui regroupe deux départements : la Seine-Maritime et l\'Eure. Elle correspond à la partie orientale de l\'ancienne province de Normandie.', 'http://fr.wikipedia.org/wiki/Haute-Normandie'),
(24, 'Centre', 39151, 'Le Centre est une région française, qui regroupe six départements : le Cher, l\'Eure-et-Loir, l\'Indre, l\'Indre-et-Loire, le Loir-et-Cher et le Loiret. Historiquement, les départements de la région Centre ont été constitués à partir de quatre provinces : l\'Orléanais (Loiret, Eure-et-Loir, Loir-et-Cher), le Berry (Cher et Indre) la Touraine (Indre-et-Loire) et l\'Anjou (partie occidentale de l\'Indre-et-Loire de Bourgueil à Château-la-Vallière). Elles sont entrées très tôt dans le royaume de France, à la formation duquel elles contribuèrent très largement : les châteaux de la Loire — de Gien à Chinon, en passant par Chambord, Blois, Chenonceaux, Azay-le-Rideau, La Ferté-Saint-Aubin... témoignent d\'un héritage commun.\r\nLa région a produit de nombreuses célébrités littéraires : Balzac, Descartes, Rabelais, Ronsard, George Sand, Charles Péguy, Proust, Jules Romains, Anatole France, Max Jacob, Maurice Genevoix, Gaston Couté, François Villon, Alain-Fournier…', 'http://fr.wikipedia.org/wiki/R%C3%A9gion_Centre'),
(25, 'Basse-Normandie', 17589, 'La Basse-Normandie est une région de France, créée en 1956, qui regroupe trois départements : le Calvados, l\'Orne et la Manche. Elle correspond à la partie occidentale de l\'ancienne province de Normandie et d\'une partie du Perche. La notion de Basse-Normandie est déjà une réalité au xvie siècle, voire au XIVe siècle, sans couvrir précisément le même territoire.', 'http://fr.wikipedia.org/wiki/Basse-Normandie'),
(26, 'Bourgogne', 31582, 'La Bourgogne (Bregogne ou Borgoégne en bourguignon-morvandiau, Borgogne en francoprovençal) est une région historique et administrative située au centre-est de la France et constituée de quatre départements : l\'Yonne, la Côte-d\'Or, la Nièvre et la Saône-et-Loire. Avec ses quatre départements et 31 582 km² de superficie, la Bourgogne est l\'une des plus vastes régions de France (7e place).\r\nLa région doit son nom aux Burgondes qui créèrent le royaume de Burgondie, devenu royaume de Bourgogne puis des Deux-Bourgogne à l\'époque carolingienne. Par la suite on distinguera le comté de Bourgogne (ou Franche-Comté de Bourgogne), qui correspond à l\'actuelle Franche-Comté, du duché de Bourgogne qui correspond à peu près à l\'actuelle région de Bourgogne.\r\nSes habitants sont appelés les Bourguignons et les Bourguignonnes.', 'http://fr.wikipedia.org/wiki/Bourgogne'),
(31, 'Nord-Pas-de-Calais', 12414, 'Le Nord-Pas-de-Calais est une région située dans le nord de la France. Elle est bordée au sud par la région Picardie, à l\'est par la Belgique et à l\'ouest et au nord par la Manche et la mer du Nord. Elle est composée de deux départements, le Nord et le Pas-de-Calais. Avec 326 hab/km2, elle compte parmi les régions d\'Europe les plus densément peuplées.\r\nElle est administrée par un Conseil régional, assisté du CESER, le Conseil régional du Nord-Pas-de-Calais et une préfecture de région, tous deux basés à Lille. Cette région, autrefois minière, est encore très industrialisée et est cultivée sur 75% de son territoire.\r\nJusqu’à la fin du XXe siècle, « Nord » désignait aussi la région, comme le département. La région faisait partie autrefois des Pays-Bas méridionaux et des Pays-Bas espagnols ; elle devint française en 1713 sous le nom de Pays-Bas français. Les provinces historiques composant le Nord-Pas-de-Calais sont, principalement, l\'Artois, le Boulonnais (annexé à la Picardie dès 1477), le Cambrésis, la Flandre et le Hainaut, désignations qui restent très courantes encore aujourd\'hui.\r\nLa région est couverte par un Schéma Régional d\'Aménagement et de Développement du Territoire (SRADT, validé en séance plénière le 22 novembre 2006).', 'http://fr.wikipedia.org/wiki/Nord-Pas-de-Calais'),
(41, 'Lorraine', 23547, 'La Lorraine (Louréne en lorrain roman et Lothringe(n) en francique lorrain et francique rhénan) est une région au Nord-Est de la France dont le nom est hérité du duché du même nom.\r\nLa Lorraine regroupe quatre départements : la Meurthe-et-Moselle, la Meuse, la Moselle et les Vosges et compte 2 337 communes. La préfecture de région est Metz.\r\nSes habitants sont appelés les Lorrains et étaient au nombre de 2 350 112 au 1er janvier 2012.\r\nLa superficie de la Lorraine est de 23 547 km2, chaque département ayant approximativement la même superficie (environ 6 000 km2). Son point culminant est le Hohneck à 1 364 mètres. Son point le plus bas est de 115 mètres au niveau de la rivière Saulx.\r\nLa région a été formée entre autres à partir des anciens duchés de Lorraine et de Bar, des Trois-Évêchés de Metz, Toul, Verdun, des comtés de Vaudémont et de Créhange, des principautés de Salm et de Commercy et de la partie sud du duché de Luxembourg (région de Thionville). Le comté de Sarrewerden, parce que sa population était en majorité protestante, a été rattaché au département du Bas-Rhin dès 1790.', 'http://fr.wikipedia.org/wiki/Lorraine'),
(42, 'Alsace', 8280, 'L\'Alsace (\'s Elsass en alsacien) est une région culturelle, historique, et administrative de l\'est de la France métropolitaine. Région de l\'Europe rhénane, elle se trouve au cœur de la mégalopole européenne (banane bleue)1. Avec une densité de 223 hab./km2, c\'est la troisième région la plus densément peuplée de France métropolitaine2 après l\'Île-de-France et le Nord-Pas-de-Calais mais c\'est aussi la plus petite par sa superficie. L’Alsace est la première région exportatrice française en valeur d\'exportations par habitant3, la deuxième quant au revenu disponible brut des ménages4, enfin, c\'est une des régions de France où le taux de chômage est le plus bas5. Ce tableau idyllique ne doit pas masquer l\'apparition de difficultés économiques depuis le début des années 20006.\r\nL\'Alsace fait partie de l\'espace culturel des anciens empires allemand et autrichien ou habsbourgeois. Le principal dialecte alsacien qui appartient au groupe linguistique du haut allemand est la troisième langue autochtone de France après le français et l\'occitan. La région historique était subdivisée en trois entités : la Haute-Alsace8, la Basse-Alsace 9 et la République de Mulhouse10 qui vota sa réunion à la France en 1798. De 1800 à 1816, l\'Alsace inclut Mandeure et l\'ancienne Principauté de Montbéliard. En 1814, Kehl est perdue et en 1815, la Prusse annexe Landau, ainsi que les territoires au nord de la Lauter. L\'Alsace est le berceau de La Marseillaise, elle a vu naître les généraux révolutionnaires Kléber et Kellermann et le capitaine Dreyfus. L\'implication des Alsaciens dans la Révolution française ainsi que l\'affaire Dreyfus ont scellé leur attachement à la République française. Après la défaite de 1871, l\'Alsace, dont est détaché le Territoire de Belfort, fait partie des provinces perdues. Le mythe et le revanchisme qu\'elles inspireront accompagneront toute la Troisième République. La région sera à nouveau en première ligne lors des deux conflits mondiaux. Elle réintègre la République Française en 1919, est à nouveau annexée par l\'Allemagne nazie en 1940 avant de redevenir française en 1945. L\'histoire houleuse de la région est une clé essentielle à la compréhension de certains particularismes locaux. Ainsi, de nombreux domaines sont régis par un droit local qui prime sur le droit général français.\r\nAujourd\'hui, l’Alsace est divisée adminstrativement en deux départements, le Bas-Rhin au nord et le Haut-Rhin au sud. Le conseil régional siège à Strasbourg, qui est aussi la plus importante (449 798 habitants) des cinq grandes agglomérations de la région devant Mulhouse (243 618 habitants), Colmar (90 842 habitants), Haguenau (58 937 habitants) et Saint-Louis (Banlieue française de Bâle - 36 225 habitants). Deux Alsaciens sur trois vivent au sein de ces cinq aires urbaines. Strasbourg et Mulhouse sont respectivement les 11e et 25e agglomérations les plus peuplées de France. De tradition industrielle forte, Mulhouse est la ville de France métropolitaine qui a la plus forte proportion de jeunes tandis que Strasbourg est le siège de plusieurs institutions européennes, dont le Parlement européen et le Conseil de l\'Europe.\r\nToutefois, dans les milieux rhénans socio-économiques, le découpage historique Bas-Rhin/Haut-Rhin est de moins en moins référencé, puisque on assiste à partage vertical pragmatique à 3 zones, s\'articulant autour des 3 plus grandes agglomérations influentes alsaciennes, Strabourg Nord-Alsace, Colmar-Sélestat pour le Centre-Alsace et Mulhouse pour le Sud-Alsace.', 'http://fr.wikipedia.org/wiki/Alsace'),
(43, 'Franche-Comté', 16202, 'La Franche-Comté (Franche-Comtât en francoprovençal, Fraintche-Comtè en franc-comtois) est une région française qui regroupe quatre départements : le Doubs, le Jura, la Haute-Saône et le Territoire de Belfort. Avec une surface de 16 202 km2, la région représente près de 3 % du territoire français. Les deux pôles urbains de la région sont la capitale régionale de région, Besançon, et le pôle économique Belfort-Montbéliard.\r\nLe nom de la région vient de l\'expression franche comté de Bourgogne, comté pouvant être du féminin en ancien français (la Région Bourgogne actuelle, était le duché de Bourgogne). La Franche-Comté est une des rares régions françaises dont le territoire actuel correspond sensiblement à une ancienne province royale, même si, depuis le xxe siècle, la région inclut aussi le Territoire de Belfort, qui était initialement un pays traditionnel de langue d\'oïl faisant partie de l\'Alsace. Aujourd\'hui le territoire de la Franche-Comté est constitué, principalement, de l\'ancienne province de Franche Comté (ou Franche Comté de Bourgogne), du comté de Montbéliard et du Territoire de Belfort, partie de l\'Alsace non annexée en 1871. Cette relative unité historique, marquée par l\'autonomie importante dont a bénéficié la comté de Bourgogne par le passé (notamment sous les Habsbourg), explique la forte identité de la région.\r\nLes habitants de Franche-Comté sont appelés les Francs-Comtois et les Francs-Comtoises. Le terme Comtois est également utilisé, comme dans la devise Comtois, rends-toi ! Nenni ma foi ! ou pour désigner des symboles de la région, de même que le cheval comtois et l\'horloge comtoise.', 'http://fr.wikipedia.org/wiki/Franche-Comt%C3%A9'),
(52, 'Pays de la Loire', 32082, 'Les Pays de la Loire sont une région française de l\'Ouest de la France regroupant les départements de la Loire-Atlantique, de Maine-et-Loire, de la Mayenne, de la Sarthe et de la Vendée.', 'http://fr.wikipedia.org/wiki/Pays_de_la_Loire'),
(53, 'Bretagne', 27208, 'La Bretagne est l\'une des 22 régions françaises de la France métropolitaine. Composée des départements des Côtes-d\'Armor, du Finistère, de l\'Ille-et-Vilaine et du Morbihan, sa préfecture et sa plus grande ville est Rennes.\r\nBaignée par la Manche au nord et par le golfe de Gascogne au sud, elle se trouve dans le Grand Ouest français, et est limitrophe des régions Basse-Normandie et Pays de la Loire.\r\nSon nom reprend celui des royaume, duché et province d\'ancien-régime, dont elle reprend également le territoire, amputé de l\'actuelle Loire-Atlantique.', 'http://fr.wikipedia.org/wiki/R%C3%A9gion_Bretagne'),
(54, 'Poitou-Charentes', 25810, 'Le Poitou-Charentes est l\'une des 22 régions de la France métropolitaine. Elle regroupe quatre départements : Charente, Charente-Maritime, Deux-Sèvres et Vienne.\r\nSes habitants sont les Picto-Charentais.\r\nElle a pour capitale régionale Poitiers qui est également la plus grande ville et la plus grande agglomération urbaine de la région.\r\nSituée dans le Grand Sud-Ouest français, elle regroupe une population de 1 760 575 habitants en 2009 répartie sur 25 809 km21, soit une densité moyenne de 68 hab./km2.\r\nElle est bordée par les régions Centre et Pays de la Loire au nord, Limousin à l\'est et enfin Aquitaine au sud. Sa façade ouest donne sur l\'océan Atlantique.', 'http://fr.wikipedia.org/wiki/Poitou-Charentes'),
(72, 'Aquitaine', 41308, 'L\'Aquitaine est une région administrative du Sud-Ouest de la France. Elle comprend cinq départements : la Dordogne, la Gironde, les Landes, le Lot-et-Garonne et les Pyrénées-Atlantiques. Son chef-lieu, Bordeaux, en est aussi la plus grande ville. L\'Aquitaine est également une région historique, dont les contours ont évolué au cours du temps. Ses habitants sont les Aquitains.', 'http://fr.wikipedia.org/wiki/Aquitaine'),
(73, 'Midi-Pyrénées', 45348, 'Le Midi-Pyrénées (Miègjorn-Pirenèus en occitan) est une région du sud-ouest de la France de tradition occitane qui regroupe huit départements : l’Ariège, l’Aveyron, la Haute-Garonne, le Gers, le Lot, les Hautes-Pyrénées, le Tarn et le Tarn-et-Garonne. C’est la deuxième plus grande région de France (derrière la Guyane) avec huit départements et plus de 45 000 km². Sa plus grande ville est Toulouse qui est également sa préfecture.', 'http://fr.wikipedia.org/wiki/Midi-Pyr%C3%A9n%C3%A9es'),
(74, 'Limousin', 16942, 'Le Limousin (Lemosin en occitan) est une région française composée des trois départements de la Corrèze, de la Creuse et de la Haute-Vienne. Elle est située presque en totalité dans le Massif central, ses habitants sont appelés les Limousins.\r\nAvec 740 743 habitants1 répartis sur près de 17 000 km2, c\'est la deuxième région la moins peuplée de France métropolitaine après la Corse. Sa démographie est caractérisée par une hausse de la population significative ces dernières années, en particulier le long des axes principaux, et un solde migratoire positif. En revanche, le taux de fécondité est faible et le taux de personnes de plus de 60 ans est le plus élevé de France.\r\nAssocié au Grand Sud-Ouest français, le Limousin est bordé par au nord par la région Centre, à l\'ouest par le Poitou-Charentes et l\'Aquitaine, au sud par le Midi-Pyrénées, et à l\'est par l\'Auvergne. Il fait partie de l\'Occitanie.', 'http://fr.wikipedia.org/wiki/Limousin'),
(82, 'Rhône-Alpes', 43698, 'Rhône-Alpes (arpitan: Rôno-Arpes; occitan : Ròse-Aups) est une région française qui regroupe huit départements : l\'Ain, l\'Ardèche, la Drôme, l\'Isère, la Loire, le Rhône, la Savoie et la Haute-Savoie.\r\nSon chef-lieu est Lyon, qui est aussi sa plus grande ville. Avec 44 000 km², elle est la deuxième région de France métropolitaine en superficie (après Midi-Pyrénées), en économie et en population (après Île-de-France) avec 6 272 467 habitants. Elle est aussi classée 6e région européenne.\r\nElle est limitrophe des régions françaises Provence-Alpes-Côte d\'Azur, Languedoc-Roussillon, Auvergne, Bourgogne et Franche-Comté, des régions d\'Italie du Val d\'Aoste et du Piémont, ainsi que des cantons suisses de Vaud, du Valais et de Genève.\r\nLa région Rhône-Alpes représente le 1/10° de la France en termes économiques, démographiques et de superficie.', 'http://fr.wikipedia.org/wiki/Rh%C3%B4ne-Alpes'),
(83, 'Auvergne', 26013, 'L\'Auvergne est d\'une part une ancienne province de France et d\'autre part une région administrative située dans le Massif central. Ses habitants sont les Auvergnats. Clermont-Ferrand est le chef-lieu de la région administrative et la capitale de l\'ancienne province. Les langues régionales sont l’occitan (Auvergnat, Haut-languedocien, Vivaro-alpin) et le bourbonnais (langue d\'oïl).\r\nLa région administrative regroupe quatre départements : l\'Allier, le Cantal, la Haute-Loire et le Puy-de-Dôme.\r\nOn distinguait autrefois les pays de Basse et de Haute-Auvergne. Le département de l\'Allier correspond approximativement au Bourbonnais. Le Velay1, occupe les deux tiers est de la Haute-Loire.', 'http://fr.wikipedia.org/wiki/Auvergne'),
(91, 'Languedoc-Roussillon', 27376, 'Le Languedoc-Roussillon est une région française composée de cinq départements. Elle est bordée au sud par l\'Espagne, Andorre et la mer Méditerranée (le golfe du Lion), et les régions françaises suivantes : Provence-Alpes-Côte d\'Azur, Rhône-Alpes, Auvergne, Midi-Pyrénées.\r\nPlusieurs éléments naturels la limitent : les Pyrénées, puis le seuil du Lauragais, les Cévennes et le fleuve Rhône. Plusieurs géographes ont parlé d\'un amphithéâtre tourné vers la mer en parlant des montagnes et des plaines languedociennes et roussillonnaises.\r\nDeux langues régionales sont historiquement présentes en Languedoc-Roussillon : l\'occitan (languedocien, auvergnat, provençal) et le catalan.', 'http://fr.wikipedia.org/wiki/Languedoc-Roussillon'),
(93, 'Provence-Alpes-Côte d\'Azur', 31400, 'La région Provence-Alpes-Côte d\'Azur est une région administrative française du Sud-Est. Elle est souvent désignée par l\'acronyme PACA.\r\nElle est limitrophe de l\'Italie dont elle est séparée par les Alpes méridionales. Au nord, elle voisine avec la région Rhône-Alpes et à l\'ouest avec le Languedoc-Roussillon dont le Rhône marque la limite. La région PACA est baignée au sud par la mer Méditerranée.\r\nLa région Provence-Alpes-Côte d\'Azur regroupe six départements issus des provinces de l\'Ancien Régime de Provence et du Dauphiné. Une partie du Vaucluse est issue de l\'annexion du Comtat Venaissin pendant la période révolutionnaire et la rive gauche du Var des Alpes-Maritimes qui constituait le comté de Nice rattaché à la France en 1860 pendant le Second Empire (le comté de Nice était une ancienne partie du duché de Provence avant 1388, date de la dédition de Nice à la Savoie). Le logo du conseil régional rappelle ces quatre régions en reprenant leur ancien blason dans certaines publicités.\r\nC\'est la 3e région qui produit le plus de richesse en France.', 'http://fr.wikipedia.org/wiki/Provence-Alpes-C%C3%B4te_d%27Azur'),
(94, 'Corse', 8680, 'La collectivité territoriale de Corse (CTC) est l\'une des 22 collectivités de niveau régional de France métropolitaine, correspondant au territoire de la Corse. Depuis la loi du 13 mai 19911, elle dispose d\'un statut particulier au sein de la République française qui lui confère davantage de pouvoir que les régions continentales, comme elle métropolitaines.', 'http://fr.wikipedia.org/wiki/Collectivit%C3%A9_territoriale_de_Corse'),
(97, 'DOM (Départements d\'outre mer)', 96642, 'Les départements d\'Outre-mer (DOM) sont une catégorie de collectivités territoriales créée par la Constitution du 27 octobre 1946 et maintenue par la Constitution du 4 octobre 1958.\r\nLa création de la catégorie des départements d\'Outre-mer fait suite à la loi n° 46-451 du 19 mars 1946, érigeant les colonies de la Guadeloupe, de la Martinique, de la Réunion et de la Guyane française en départements français.\r\nL\'article 4 de la loi n° 46-2385 du 27 octobre 1946, sur la composition et l\'élection de l\'Assemblée de l\'Union française1, en donne la première énumération.\r\nIls sont aussi des régions d\'Outre-mer, correspondant à des collectivités d\'Outre-mer, c\'est-à-dire des collectivités territoriales intégrées à la République française au même titre que les départements ou régions de la France métropolitaine. L\'appellation préconisée par certains de DOM-ROM ou DROM (département et région d\'Outre-mer) reste peu usitée.\r\nLe néologisme « domien » a été créé comme gentilé pour les personnes originaires des DOM ou y habitant.', 'http://fr.wikipedia.org/wiki/France_d%27outre-mer');
